ys homage to that dog (my fur brother) and to my father, who loves his children (of all varieties) no matter the hardships that they and he may endure. In terms of the art work, i created this from art marker and pencil overlay. I\u2019ll add a video to this post where you can see this technique in action. #happybirthday #daddy #love #arttherapy #OT #occupationaltherapy #loveisblind #puppy #pet #furbaby"}}]},"shortcode":"B9w-ydPlBCN","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584299009,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/90089468_512473202986998_1714493406225439768_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=yGvD--k1Ht0AX-GLh6Z\u0026oh=6588a1321f4e169d0b1ba6ad3e16bff0\u0026oe=5EA2F240","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"30373627630"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/90089468_512473202986998_1714493406225439768_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=yGvD--k1Ht0AX-GLh6Z\u0026oh=e07c5f2a9acf189c8fa1e74d8388aab4\u0026oe=5EA54DF7","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/90089468_512473202986998_1714493406225439768_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=yGvD--k1Ht0AX-GLh6Z\u0026oh=8c8344aa23719dde47f77878c2f5c18a\u0026oe=5EA3BF50","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/90089468_512473202986998_1714493406225439768_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=yGvD--k1Ht0AX-GLh6Z\u0026oh=ad42e1922ad074f7868109d1256f1e1f\u0026oe=5E9A971A","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s320x320/90089468_512473202986998_1714493406225439768_n.jp
